import '../App.css';
import React from "react";
import stashPic from "../images/stash.jpeg";

function Home() {
    return (          
      <div clasName="cover-container d-flex w-100 h-100 p-3 mx-auto flex-column">
          <body id="home">
                <main className="px-3">
                    <h1>Welcome to Fabricadabra</h1>
                    <p className="lead">A magical place to keep a sewist's stash organized</p>
                    <img src={stashPic}></img>
                </main>
          </body>
    </div>
      );

    }

    export default Home;
